Bayer 04 Leverkusen have reportedly 𝑹𝑬𝑱𝑬𝑪𝑻𝑬𝑫 Liverpool’s offer for Florian Wirtz! ❌

Liverpool had offered a club-record of £110M to secure the services of the German playmaker, but Leverkusen are demanding £125M. 💰

