Liverpool would have to pay Benfica another €5m (£4.3m) for the 2022 transfer of Darwin Núñez whenever the Uruguayan makes his 50th Premier League start for the Reds. 👀

He's currently on 49 top-flight starts for Liverpool. Will Slot hand Núñez his 50th league start before the end of the season? 🫵

