Jürgen Klopp is reportedly already unhappy with his new job as Red Bull’s Head of Global Soccer and would consider returning to management for Real Madrid. ⚪️

Real Madrid have just been knocked out of the Champions League by Arsenal and they are currently second in La Liga title race with Barcelona favourites to win the league. ❌

