Sir Jim Ratcliffe is to close Manchester United's Old Trafford staff canteen and instead offer employees a free piece of fruit as part of more cost-cutting measures at the club. ❌

Lunch at Manchester United’s Carrington training ground has apparently been reduced to soup and sandwiches for everyone apart from first-team players, and that includes for coaches and analysts. 🍜

@bbcsport

Barcelona have reportedly ‘contacted’ five Premier League clubs – including Arsenal regarding the availability of Frenkie de Jong. 🇳🇱

De Jong's future at Barcelona remains uncertain as he approaches the final year of his contract. With the impressive performances of homegrown talents Pedri, Gavi, and Marc Casado, playing time has been very limited and Barca could be ready to cash in on the midfielder. 😔

